func TestBs(t *testing.T) {
	tests := []struct {
		in   []int
		want int
	}{
		{in: []int{0, 0, 0, 0, 1}, want: 4},
		{in: []int{0, 0, 0, 1, 1}, want: 3},
		{in: []int{0, 0, 1, 1, 1}, want: 2},
		{in: []int{0, 1, 1, 1, 1}, want: 1},
	}
	for i, tt := range tests {
		t.Run(fmt.Sprint(i), func(t *testing.T) {
			got := bs(tt.in)
			if got != tt.want {
				t.Fatalf("got: %v, want %v", got, tt.want)
			}
		})
	}
}
